import React from "react";
import './App.sass';

function App() {
  return (
    <div className="metro-body">
        <div class="absolute bottom-0 left-90">
        <button class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded-full">
           Button
          </button>
        </div>
    </div>
  );
}

export default App;
